import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Table from "react-bootstrap/Table";

import "./App.css";

import StarfieldAnimation from "react-starfield-animation";

class Star extends Component {
  render() {
    return (
      <StarfieldAnimation
        style={{
          position: "absolute",
          width: "100%",
          height: "600px"
        }}
      />
    );
  }
}

class PictureOfDay extends Component {
  render() {
    console.log(this.props);
    console.log("what i need");
    console.log(this.props.img.url);

    if (!this.props) {
      return null;
    }
    if (
      new String(this.props.img.type).valueOf() == new String("video").valueOf()
    ) {
      console.log("is a video");
      return (
        <div id="video" className="header row">
          <div id="video-content" className="header-img col-4">
            <iframe width="100%" height="60%" src={this.props.img.url}></iframe>
          </div>
          <div id="video-text" className="col">
            <h1 id="video-title">{this.props.img.title}</h1>
            <article>{this.props.img.explanation}</article>
          </div>
        </div>
      );
    } else {
      return (
        <div className="header row">
          <div className="header-img col-4">
            <img width="100%" height="60%" src={this.props.img.url} />
          </div>
          <div id="apod-text" className="col">
            <h1 id="apod-title">{this.props.img.title}</h1>
            <article>{this.props.img.explanation}</article>
          </div>
        </div>
      );
    }
  }
}

class Asteroid extends Component {
  render() {
    var str = "";
    var is_precent = 0.3;
    if (this.props.asteriod.is_hazardous) {
      str = "Yes";
      is_precent = 0.8;
    } else {
      str = "No";
    }

    var dia_precent =
      (this.props.asteriod.estimated_diameter_max -
        this.props.asteriod.min_diameter +
        0.01) /
      (this.props.asteriod.max_diameter - this.props.asteriod.min_diameter);

    var dis_percent =
      1 -
      (this.props.asteriod.miss_distance - this.props.asteriod.min_dis) /
        (this.props.asteriod.max_dis - this.props.asteriod.min_dis);

    var tdStyle = {
      background: "RGB(0,255,255," + dia_precent + ")"
    };

    var isStyle = {
      background: "RGB(255,0,0," + is_precent + ")"
    };

    var disStyle = {
      background: "RGB(255,0,255," + dis_percent + ")"
    };

    return (
      <tr key={this.props.asteriod.name}>
        <td>{this.props.asteriod.date}</td>
        <td>{this.props.asteriod.name}</td>
        <td style={tdStyle}>{this.props.asteriod.estimated_diameter_max}</td>
        <td style={disStyle}>{this.props.asteriod.miss_distance}</td>
        <td style={isStyle}>{str}</td>
      </tr>
    );
  }
}

