class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      purchased: [],
      notPurchased: []
    };
  }

  componentDidMount() {
    if (localStorage.getItem("purchased") === null) {
      console.log("download");
      const symbols = [
        "AMZN",
        "GOOGL",
        "XOM",
        "JNJ",
        "GE",
        "REAL",
        "ATVI",
        "TXN",
        "AA",
        "DIS",
        "MMM",
        "CSCO",
        "ADBE",
        "NEW",
        "A",
        "F",
        "C",
        "D",
        "X",
        "O",
        "K",
        "I",
        "V",
        "BAC"
      ];
      var allstocks = [];
      for (var j = 0; j < symbols.length; j++) {
        const url = this.urlForStockInfo(symbols[j]);
        console.log(url);
        fetch(url)
          .then(r => r.json())
          .then(data => {
            console.log("here is data");
            console.log(data);
            var stock = {};
            stock["symbol"] = data.symbol;
